Brian Azzarello takes a dark and disturbing look at what makes the Joker tick, getting into his psyche as few have before or since. With amazing art by Lee Bermejo, you surely don't want to miss this one. Especially great in the face of the recent &quot;Death of the Family&quot; storyline. Thanks to Archangel + Zone-Empire for this digital copy, please seed and enjoy! :-)
